  [],\n\t\"num_tags\": 0,\n\t\"name\": \"physical-profile-data-and-meteorological-data-collected-from-moored-buoys-in-the-northwest-gulf\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Minerals Management Service (MMS) awarded
  a contract to Science Applications International Corporation (SAIC) to conduct a
  study titled: Survey of Deepwater Currents in the Northwestern Gulf of Mexico (often
  referred to as the NW Gulf Study). The timing and general area of investigation
  extends the focus of a series of preliminary stydies that as a group will provide
  a basis for effective design and implementation of comprehensive ocean investigations
  having a goal of in-depth understanding and characterization of Gulf of Mexico (GOM)
  circulation and dynamics. As identified in the Request for Proposal (RFP), a possible
  design for the study involved 13 full-depth moorings instrumented with various and
  appropriate sensors to resolve and estimate key parameters and conditions within
  the study area. Additionally, a combination of remotely sensed (satellite) data
  types (e.g., altimetry, radiometry, and color) were to be acquired and used to aid
  in the interpretation of mesoscale features and physical data in the study area.
  Within the scope of work for this study, there was a specification for coordination
  of all activities with oceanographers from Mexico who were responsible for Mexican
  Sector activities and data.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
